package com.sapirgolan.myapplication.activity.object;

import java.util.ArrayList;

public class KindPets {

    private String name = "";
    private String imageKind = "data:image/jpeg;base64,";
    private ArrayList<Question> questions;


    public KindPets() {
    }

    public KindPets(String title, String imageKind) {
        this.name = title;
        this.imageKind = "data:image/jpeg;base64,";
        this.questions = new ArrayList<>();
    }

    public ArrayList<Question> getQuestions() {
        return questions;
    }

    public void setQuestions(ArrayList<Question> questions) {
        this.questions = questions;
    }

    public String getName() {
        return name;
    }
    public KindPets setName(String name) {
        this.name = name;
        return this;
    }

    public KindPets setImageKind(String imageKind) {
        this.imageKind = imageKind;
        return this;
    }
    public String getImageKind() {
        return imageKind;
    }


}
